webpackJsonp([434],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-challenge-dire-bonjour-aux-elements-html.json":function(e,l){e.exports={data:{markdownRemark:{html:"<p>Les éléments HTML sont écrits avec une balise de début, une balise de fin, et du contenu entre les deux:</p>\n<ul>\n<li><code>&#x3C;nom-de-la-balise>contenu&#x3C;/nom-de-la-balise></code></li>\n</ul>\n<p>L'élément HTML regroupe tout ce qui est inclus depuis la balise du début jusqu'à la balise de fin:</p>\n<ul>\n<li><code>&#x3C;p>Mon premier paragraphe HTML.&#x3C;/p></code></li>\n</ul>\n<p>Les balises d'ouverture ressemblent à ceci: <code>&#x3C;h1></code>, et les balises de fermeture à ceci: <code>&#x3C;/h1></code></p>\n<ul>\n<li>Notez que la seule différence entre une balise d'ouverture et une balise de fermeture, est que la balise de fermeture a une barre oblique après le chevron d'ouverture. La barre oblique dans la balise de fermeture est très importante car elle indique que la balise est la fin de cet élément.</li>\n</ul>",frontmatter:{title:"Challenge Dire Bonjour Aux Elements HTML",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/challenge-dire-bonjour-aux-elements-html/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/challenge-dire-bonjour-aux-elements-html/"}}}});
